import React from 'react'

function Popup(props) {
    return (props.trigger)?(
        <div className="popUp">
            <div className="popUp-inner">
                <button className="closeBtn">Close</button>
                {props.children}
            </div>
        </div>
    ): "";
}

export default Popup
